Ext.data.JsonP['Mobile_Backend_Services_Release_Notes']({"guide":"<?xml version=\"1.0\" encoding=\"UTF-8\" ?>\n<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\"\n        \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\n<html xmlns=\"http://www.w3.org/1999/xhtml\">\n<head>\n    <title>Mobile Backend Services Release Notes</title>\n\n    <meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\">\n    <meta content=\"Scroll EclipseHelp Exporter\" name=\"generator\">\n\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\" media=\"print\">\n</link></link></link></meta></meta></head>\n<body>\n    <div class=\"container\">\n        <div class=\"header\"/>\n\n        <div id=\"src-49153826\" class=\"content\">\n                        <h1>Mobile Backend Services Release Notes</h1>\n    <div class=\"section section-2 \" id=\"src-49153826_MobileBackendServicesReleaseNotes-MobileBackendServices1.6.0.sp2-17November2017\">\n        <h2 class=\"heading \"><span>Mobile Backend Services 1.6.0.sp2 - 17 November 2017</span></h2>\n    <p>This release of Mobile Backend Services (MBS) includes version 2.0.7 of the CLI and 1.6.0.sp2 of the server, and includes the following improvement and fixed issue.    </p>\n    </div>\n    <div class=\"section section-2 \" id=\"src-49153826_MobileBackendServicesReleaseNotes-Improvement\">\n        <h2 class=\"heading \"><span>Improvement</span></h2>\n<ul class=\" \"><li class=\" \">    <p>Previously, only Google Cloud Messaging (GCM) was supported for Android pushes. Now, the new version of GGM, Firebase Cloud Messaging (FCM), is also supported. For additional FCM information, visit <a class=\"external-link external-link\" href=\"https://console.firebase.google.com/\" target=\"_blank\">https://console.firebase.google.com</a>.    </p>\n</li></ul>    </div>\n    <div class=\"section section-2 \" id=\"src-49153826_MobileBackendServicesReleaseNotes-Fixedissue\">\n        <h2 class=\"heading \"><span>Fixed issue</span></h2>\n<ul class=\" \"><li class=\" \">    <p>Fixed issue with Chinese characters not being properly displayed in the Dashboard. Now, Chinese characters are properly displayed in the Dashboard.    </p>\n</li></ul>    </div>\n    <div class=\"section section-2 \" id=\"src-49153826_MobileBackendServicesReleaseNotes-RecentReleases\">\n        <h2 class=\"heading \"><span>Recent Releases</span></h2>\n<ul class=\"childpages-macro \"><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/Mobile_Backend_Services_1.6.0.sp2_Release_Note\">Mobile Backend Services 1.6.0.sp2 Release Note</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/Mobile_Backend_Services_1.6.0.sp1_Release_Note\">Mobile Backend Services 1.6.0.sp1 Release Note</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/ArrowDB_1.5.2_Release_Note\">ArrowDB 1.5.2 Release Note</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/ArrowDB_1.5.1_Release_Note\">ArrowDB 1.5.1 Release Note</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/ArrowDB_1.5.0_Release_Note\">ArrowDB 1.5.0 Release Note</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/ArrowDB_1.4.0_Release_Note\">ArrowDB 1.4.0 Release Note</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/ArrowDB_1.3.0_Release_Note\">ArrowDB 1.3.0 Release Note</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/ArrowDB_1.2.0_Release_Note\">ArrowDB 1.2.0 Release Note</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/ArrowDB_1.1.13_Release_Note\">ArrowDB 1.1.13 Release Note</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/ArrowDB_1.1.12_Release_Note\">ArrowDB 1.1.12 Release Note</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/ArrowDB_1.1.11_Release_Note\">ArrowDB 1.1.11 Release Note</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/ACS_2014_07_March_Release_Note\">ACS 2014 07 March Release Note</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/ACS_2013_7_November_Release_Note\">ACS 2013 7 November Release Note</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/ACS_2013_6_December_Release_Note\">ACS 2013 6 December Release Note</a>    </p>\n</li><li class=\" \">    <p><a class=\"document-link \" href=\"#!/guide/ACS_2013_31_January_Release_Note\">ACS 2013 31 January Release Note</a>    </p>\n</li></ul>    </div>\n        </div><a id=\"editButton\" href=\"https://wiki.appcelerator.org/pages/editpage.action?pageId=49153826\"><span>Edit</span></a>\n    \n        \n    </div>\n</body>\n</html>\n","title":"Mobile Backend Services Release Notes"});